            for (const value of values as string[]) {
                const tagValue = tag + value;

                // Get all events with this tag
                const eventIds = this.eventTags.getSet(tagValue);
                if (!eventIds) continue;

                // Go through each event that came back
                eventIds.forEach((id) => {
